(ns opencv3.boundingboxes
(:require
  [opencv3.core :refer :all]
  [opencv3.colors.rgb :as rgb]
  [opencv3.utils :as u]))

; http://docs.opencv.org/2.4/doc/tutorials/imgproc/shapedescriptors/bounding_rects_circles/bounding_rects_circles.html
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@

(def kikyu
  (-> "resources/chapter03/mongolfieres.jpg"
   imread))

(u/mat-view kikyu)

(def wrong-mask
  (-> kikyu 
      clone 
      (cvt-color! COLOR_BGR2GRAY)
 	  (threshold! 250 255 THRESH_BINARY)
      (median-blur! 7)))

(u/mat-view wrong-mask)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"500\" height=\"383\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6491f603 \"BufferedImage@6491f603: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@55fc79e5 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 500 height = 383 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; @@
(def mask
  (-> kikyu 
      clone 
      (cvt-color! COLOR_RGB2HSV)
 	  (in-range! (new-scalar 10 30 30) (new-scalar 30 255 255))
      (median-blur! 7)
      ))

(u/mat-view mask)

(def work (-> mask bitwise-not!))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;opencv3.boundingboxes/work</span>","value":"#'opencv3.boundingboxes/work"}
;; <=

;; @@

(def contours (new-arraylist))
(find-contours work contours (new-mat) RETR_LIST CHAIN_APPROX_SIMPLE (new-point 0 0))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@

; draw bounding box using bounding-rect
(def output_ (clone kikyu))

(def my-contours 
  (filter 
  #(and
  (> (contour-area %) 50 )
  (> (.height (bounding-rect %)) 40)  
  (> (.width (bounding-rect %)) 60))                    
   contours))

(doseq [c my-contours]
  ;(if (> (contour-area c) 50 )
    (let [ rect (bounding-rect c)]
   ;   (if (and  (> (.height rect) 40)  (> (.width rect) 60))
      (circle
        output_
        (new-point (+ (/ (.width rect) 2) (.x rect))
                   (+ (.y rect) (/ (.height rect) 2)))
        100
        rgb/tan
        5)))

(count my-contours)
(-> output_ (u/resize-by 0.5) u/mat-view )

;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"250\" height=\"191\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x46009d2e \"BufferedImage@46009d2e: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@1a40145 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 250 height = 191 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@

; draw bounding box using bounding-rect
(def output (clone kikyu))

(doseq [c my-contours]
  ;(if (> (contour-area c) 50 )
    (let [ rect (bounding-rect c)]
  ;    (if (and  (> (.height rect) 40)  (> (.width rect) 60))
      (rectangle
        output
        (new-point (.x rect) (.y rect))
        (new-point (+ (.width rect) (.x rect)) (+ (.y rect) (.height rect)))
        rgb/tan
        5)))
(-> output (u/resize-by 0.5) u/mat-view )
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"250\" height=\"191\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x3e666c08 \"BufferedImage@3e666c08: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@1a40145 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 250 height = 191 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@

; draw contours
(defn draw-contours! [img contours]
 (dotimes [i (.size contours)]
     (draw-contours img contours i rgb/tan 10)) img)

(->
  kikyu
  clone
  (draw-contours! contours)
  (u/resize-by 0.5)
  (u/mat-view))
